import Foundation
import UIKit
import SnapKit

class SelectedFeelingsCollectionViewContentView: UIView {
    static var reuseIdentifier: String {
        get {
            return "SelectedFeelingsCollectionViewContentView"
        }
    }

    var data: Feeling? {
        didSet {
            guard let _data = data else { return }

            imageView.image = _data.image
            feelingLabel.text = _data.visibleFeelName()
        }
    }

    private lazy var imageView: UIImageView = {
        let view = UIImageView()
        view.setRounded()
        return view
    }()

    private lazy var feelingLabel: UILabel = {
        let label = UILabel()
        label.numberOfLines = 0
        label.textColor = .white
        label.font = .boldSystemFont(ofSize: CGFloat(NumberConstants.selectedFeelingsCollectionViewCellLabelSize))
        label.textAlignment = .center
        return label
    }()

    required init?(coder: NSCoder) {
        super.init(coder: coder)

        setupViews()
    }

    override init(frame: CGRect) {
        super.init(frame: .zero)

        setupViews()
    }

    private func setupViews() {
        addSubview(imageView)
        addSubview(feelingLabel)

        imageView.snp.makeConstraints { make in
            make.top.leading.trailing.equalToSuperview()
            make.height.width.equalTo(NumberConstants.selectedFeelingsCollectionViewCellImageSize)
        }

        feelingLabel.snp.makeConstraints { make in
            make.top.equalTo(imageView.snp.bottom).offset(NumberConstants.layoutMarginMin)
            make.bottom.leading.trailing.equalToSuperview()
        }
    }
}
